import { View, Text, Pressable } from "react-native";
import React from "react";
import Ionicons from "react-native-vector-icons/Ionicons";
import FontAwesomeIcons from "react-native-vector-icons/FontAwesome5";

// CSS styles
const styles = {
  container: {
    backgroundColor: "white",
    marginBottom: 2,
  },
  sectionTitle: {
    marginLeft: 2,
    paddingHorizontal: 4,
    marginTop: 2,
    fontSize: 14,
    color: "#0069fc",
    fontWeight: "bold",
  },
  listItemContainer: {
    flexDirection: "row",
    marginHorizontal: 2,
    marginTop: 2,
    paddingVertical: 2,
    paddingLeft: 4,
    borderBottomWidth: 1,
    borderBottomColor: "gray",
    alignItems: "center",
  },
  listItemText: {
    fontSize: 16,
    fontWeight: "bold",
    paddingLeft: 4,
    width: "75%",
  },
  listItemSubText: {
    fontSize: 12,
    fontWeight: "bold",
    color: "gray",
    width: "25%",
    textAlign: "right",
  },
};

const AccountVsSecurity = ({ navigation }) => {
  navigation.setOptions({
    headerTitle: () => (
      <View style={{ flexDirection: "row", alignItems: "center" }}>
        <Text style={{ color: "white", fontSize: 20, fontWeight: "bold" }}>
          Tài khoản và bảo mật
        </Text>
      </View>
    ),
    headerStyle: {
      backgroundColor: "#0091FF",
      shadowColor: "#fff",
    },
    headerTintColor: "#fff",
    headerTitleStyle: {
      fontWeight: "bold",
      fontSize: 20,
    },
  });

  return (
    <View>
      {/* Body */}
      <View>
        {/* Tài khoản */}
        <View style={styles.container}>
          <Text style={styles.sectionTitle}>Tài khoản</Text>
          <Pressable style={styles.listItemContainer}>
            <Ionicons name="call-outline" size={24} color="#a5a9aa" />
            <View style={{ width: "75%", paddingLeft: 4 }}>
              <Text style={styles.listItemText}>Số điện thoại</Text>
              <Text style={{ color: "gray", fontWeight: "bold" }}>
                (+84) 338 123 689
              </Text>
            </View>
            <View
              style={{
                width: "25%",
                flexDirection: "row",
                justifyContent: "flex-end",
              }}
            >
              <Ionicons name="arrow-forward" size={20} color="#a5a9aa" />
            </View>
          </Pressable>
          {/* Other items... */}
        </View>

        {/* Bảo mật */}
        <View style={styles.container}>
          <Text style={styles.sectionTitle}>Bảo mật</Text>
          <Pressable style={styles.listItemContainer}>
            <Ionicons
              name="shield-checkmark-outline"
              size={24}
              color="#a5a9aa"
            />
            <View style={{ width: "75%", paddingLeft: 4 }}>
              <Text style={styles.listItemText}>Kiểm tra bảo mật</Text>
              <Text style={{ color: "#f7c001", fontWeight: "bold" }}>
                2 vấn đề cần xử lý
              </Text>
            </View>
            <View
              style={{
                width: "25%",
                flexDirection: "row",
                justifyContent: "flex-end",
              }}
            >
              <Ionicons name="warning" size={20} color="#f7c001" />
              <Ionicons name="arrow-forward" size={20} color="#a5a9aa" />
            </View>
          </Pressable>
          {/* Other items... */}
        </View>

        {/* Đăng nhập */}
        <View style={styles.container}>
          <Text style={styles.sectionTitle}>Đăng nhập</Text>
          <Pressable style={styles.listItemContainer}>
            <FontAwesomeIcons name="shield-virus" size={24} color="#a5a9aa" />
            <View style={{ width: "75%", paddingLeft: 4 }}>
              <Text style={styles.listItemText}>Bảo mật 2 lớp</Text>
              <Text style={{ color: "gray", fontWeight: "bold" }}>
                Thêm hình thức xác nhận để bảo vệ tài khoản khi đăng nhập trên
                thiết bị mới
              </Text>
            </View>
            <View
              style={{
                width: "25%",
                flexDirection: "row",
                justifyContent: "flex-end",
              }}
            >
              <Ionicons name="arrow-forward" size={20} color="#a5a9aa" />
            </View>
          </Pressable>
          {/* Other items... */}
        </View>

        {/* Xoá tài khoản */}
        <Pressable
          style={[styles.listItemContainer, { backgroundColor: "white" }]}
        >
          <Text style={styles.listItemText}>Xoá tài khoản</Text>
          <View
            style={{
              width: "25%",
              flexDirection: "row",
              justifyContent: "flex-end",
            }}
          >
            <Ionicons name="arrow-forward" size={20} color="#a5a9aa" />
          </View>
        </Pressable>
      </View>
    </View>
  );
};

export default AccountVsSecurity;
